CREATE TABLE IF NOT EXISTS data (
county VARCHAR(26) NULL,
state VARCHAR(14) NULL,
latitude FLOAT NULL,
longitude FLOAT NULL,
date VARCHAR(10) NULL,
number INT NULL,
classification VARCHAR(7) NULL,
geohash VARCHAR(10) NULL,
temperature_high VARCHAR(6) NULL,
temperature_mid VARCHAR(6) NULL,
temperature_low VARCHAR(6) NULL,
dew_point VARCHAR(6) NULL,
humidity VARCHAR(4) NULL,
cloud_cover VARCHAR(4) NULL,
moon_phase VARCHAR(4) NULL,
precip_intensity VARCHAR(6) NULL,
precip_probability VARCHAR(4) NULL,
precip_type VARCHAR(4) NULL,
pressure VARCHAR(7) NULL,
summary VARCHAR(108) NULL,
uv_index VARCHAR(2) NULL,
visibility VARCHAR(4) NULL,
wind_bearing VARCHAR(3) NULL,
wind_speed VARCHAR(5) NULL
);

